import React from 'react';
import Container from "@mui/material/Container";
import Box from "@mui/material/Box";
import Typography from "@mui/material/Typography";
import Button from "@mui/material/Button";
import WaterInput from './WaterInput';

const WaterBody = (props) => {
  return (
    <Container sx={{width: 1000, height: 500, backgroundColor: "white", borderRadius: 5}}>
        <Box sx={{ height: 480, width: 550, border: "1px solid black", display: "inline-block", mt: 1, borderRadius: 5}}>
        <div>
            {props.products.map((product, index) => (  
            <div key={index} className='items'>
                <img src={product.imageUrl} alt="image" />
                <p>Title:   {product.title}</p>
                <p>Price: {product.price}</p>
                <p>Description: {product.description}</p>
                <button><Link to={`/update/${product._id}`}> Update {product.title} </Link></button>
                <button ><Link to={`/product/${product._id}`}> View {product.title}'s Page! </Link></button>
                <button onClick={(e) => {DeleteItem(product._id)}}>Delete</button>
            </div>
            ))}
        </div>


        </Box>
        <Box sx={{ position: "absolute", mt: 15, ml: -53, display: "inline-block"}}>
            <WaterInput />
        </Box>
    </Container>
  )
}

export default WaterBody;
